uniform sampler2D mainTexture;
layout(std140) uniform Constant {
  vec4 mainColor;
  vec4 color1;
  vec4 color2;
  vec4 color3;
  vec4 color4;
  vec4 color5;
};
vec4 frag () {
  vec4 uv = vec4(0.0,0.0,0.0,1.0);
  vec2 v_uvn = vec2(v_uv.x ,v_uv.y);
  uv = texture(mainTexture, v_uvn);
  vec2 dp1=vec2(1.0,1.0);
  vec2 dp2=vec2(poss.x,poss.z);
  float d=dot(dp1,dp2)/2.0+0.5;
  float p=1.0-d;
  vec4 color_land=vec4(color2.x*d+color4.x*p,color2.y*d+color4.y*p,color2.z*d+color4.z*p,1.0);
  vec4 color_hill=vec4(color1.x*d+color5.x*p,color1.y*d+color5.y*p,color1.z*d+color5.z*p,1.0);
  if(poss.y>0.18){
    return color3;
  }
  else if(poss.y>0.14){
    vec4 dv=vec4(color3.x-color_hill.x,color3.y-color_hill.y,color3.z-color_hill.z,1.0)*(poss.y-0.14)/(0.04);
    return vec4(color_hill.x+dv.x,color_hill.y+dv.y,color_hill.z+dv.z,1.0);
  }
  else if(poss.y>0.05){
    return color_hill;
  }
  else if(poss.y>-0.02){
    vec4 dv=vec4(color_hill.x-color_land.x,color_hill.y-color_land.y,color_hill.z-color_land.z,1.0)*(poss.y+0.02)/(0.07);
    return vec4(color_land.x+dv.x,color_land.y+dv.y,color_land.z+dv.z,1.0);
  }
  else{
      return color_land;
  }
}
layout(location = 0) out vec4 cc_FragColor;
void main() { cc_FragColor = frag(); }

glsl1.vert:
precision highp float;
uniform highp mat4 cc_matViewProj;
uniform highp mat4 cc_matWorld;
attribute vec2 a_texCoord;
attribute vec4 a_position;
attribute vec4 a_normal;
varying vec4 poss;
varying vec4 normal;
varying vec2 v_uv;
   uniform vec4 tilingOffset;
vec4 vert () {
  vec4 pos = cc_matViewProj * cc_matWorld * a_position;
  v_uv = a_texCoord* tilingOffset.xy + tilingOffset.zw;
  poss = a_position;
  normal = a_normal;
  return pos;
}
void main() { gl_Position = vert(); }

